section.p:
Зрители не успели и минуты подумать над этой позицией: мощный удар ветра сбил с доски 
                пешку а6. Я с грустью услышал, как она стукнулась о скалу и скрылась в пропасти; 
                остальные фигуры поехали вверх по доске... Они были сдвинуты порывом ветра на три ряда вверх.

Были приняты меры предосторожности: во всех углах шахматного двора были поставлены пушки; 
                у всех входов, ведших к шахматному двору, расположились с обнаженными мечами самые опытные 
                палачи. В проходах и смежных дворах маневрировали отряды шахской лейбгвардии...
